// import { render } from "@testing-library/react";
 //import { render } from 'react-dom';
// import ReactDOM from 'react-dom';

import './mystyle.css';

function App() {
  const element = "Helloword"
  const numbers = ['1', '2', '3', '4', '5'];
  const lists = numbers.map((number) => number * 2);
  const result = Array.isArray(numbers);
  console.log(result);
  const newArray = new Array(5);
  console.log(newArray.fill(2));
  console.log(lists);

  let m = "Hello"; 
  let n = `${m} World `;
  console.log(n);

  return(
    <div>
      <h1>{element}</h1>
      <p>Array Before Multiplication</p>
      <ul>
        <li> {numbers} </li>
      </ul>
      <p>Array After Multiplication</p>
      <ul>
        <li> 
          {lists}
        </li>
      </ul>
      <h3>{result}</h3>
      <p> {n}</p>
    </div>

  );
}

export default App;
